import List from "./List";
import { FaMinusSquare, FaPlusSquare, FaTrash } from "react-icons/fa";

const NewList = ({ list }) => {
  // console.log(list);
  return (
    <>
      {Object.keys(list).length
        ? Object.keys(list).map((key, i) => (
            <>
              <ul type="none" key={key}>
                <li key={key} value={key}>
                  {Object.keys(list[key]).length ? (
                    <FaMinusSquare
                      style={{
                        fontSize: "0.75rem",
                        paddingRight: "0.25rem",
                        cursor: "pointer",
                      }}
                    />
                  ) : null}
                  {key}{" "}
                  <FaTrash
                    style={{
                      cursor: "pointer",
                      float: "right",
                      marginRight: "40rem",
                      fontSize: "0.75rem",
                    }}
                  />
                </li>
                <List list={list[key]} />
              </ul>
            </>
          ))
        : null}
    </>
  );
};

export default NewList;
